Приглашаются лидеры и участники различных групп, работающих в области образования, социального предпринимательства, аутсорсинговых пространств, НКО и развивающих эти сообщества (в числе таких Метаверситет, КСП, Кружковое движение и других), чтобы совместно картировать свои запросы на ИТ продукты и сервисы, необходимые для качественного прорыва в деятельности, и воплотить их в функциональные прототипы.
Действуя на волне зарождающегося тренда перехода от платформ к экосистемам независимых взаимодополняющих продуктов, в рамках 1ого цикла лаборатории (11-13 июля) мы создадим карту-гипотезу ИТ-экосистемы для развития сообществ и выберем из нее наиболее актуальные сервисы, которые будут прототипированы на втором цикле лаборатории (17-19 июля) – Хакатоне ИТ-инструментов для сообществ.
Примеры возможных запросов и сервисов:
- сервис анонсирования проводимых проектов и сборки их в отдельные программы, востребованные внешними стэйкхолдерами;
- сервис поиска и мэтчинга кадров/компетентов под проекты и внутренние программы развития;
- сервис сравнения траектории развития референтов с целью формирования личной образовательной траектории;
- сервисы по построению разных типов кооперации;
- сервис делегирования управленческих полномочий и т.д.
